import React from "react";
import DroneService from "../services/DroneService";

const DroneListItem = ({droneData, drone}) => {
    if (droneData[drone].pilotInformation !== null) {
        return(
            <li>
                <div>
                    {droneData[drone].serialNumber} distance to nest: {Math.round((droneData[drone].closestToNest)/1000)}
                    <br/>
                    {droneData[drone].pilotInformation.pilotId}
                    <br/>
                    {droneData[drone].pilotInformation.firstName}
                    <br/>
                    {droneData[drone].pilotInformation.lastName}
                    <br/>
                    {droneData[drone].pilotInformation.phoneNumber}
                    <br/>
                    {droneData[drone].pilotInformation.email}
                    <br/>
                </div>
            </li>
        )
    }
    return(
        <li>
            <div>
                {droneData[drone].serialNumber} distance to nest: {Math.round((droneData[drone].closestToNest)/1000)}
            </div>
        </li>
    )
    };

export default DroneListItem;
